more trips than Casual riders on weekdays and casual riders take a similar amount of rides on the weekends.\n","\n","* Summer seems to be the busiest time for rides with longer durations, this spans from May-September, although Members seem to make high usage in October as well.\n","\n","\n","## **Recommendations**\n","\n","* Offer discounted membership fees for the first year to incentivize casual riders to consider a membership.\n","\n","* Offering a seasonal membership option for casual riders who would only make use in the summer months.\n","\n","* Offering a weekday membership to convert Casual riders to Members and help grow bike usage.\n","\n","* Focusing on advertising with social media showing the incentives of becoming a member over just a casual rider.\n","\n","\n","## **Further Exploration**\n","\n","* Apply temporary marketing promotions and collect new data of price vs demand to determine a good price point for standing promotions.\n","\n","* Figure out if there is enough bikes to handle the demand on the busiest days. This will help to make sure there isnt a missed sale due to bike shortage.\n","\n","* Find a way to collect information on the riders to see where they are located. If the issue of transferring casual riders to members is because casual riders tend to be vacationing or just visiting, making them members will not solve the issues at hand."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":557.76107,"end_time":"2023-01-06T01:29:00.061891","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-01-06T01:19:42.300821","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}